/*  
    Connexion au dashboard admin
*/

import React , {useState , useEffect} from 'react'
import axios from 'axios'
import logo from '../assets/img/logo.png'
import '../assets/css/login.css'
export const Login = () => {

    const BASE_URL = "http://127.0.0.1:8000/api/admin_login"

    const handleSubmit = () =>{
        axios.get('/sanctum/csrf-cookie').then(response => {
            axios.post(BASE_URL, {
                'email' : "darnoul20@gmail.com",
                'password' : "$dnifpi"
            })
            .then(res =>{
                console.log(res.data)
            })
        });
    }
    return (
        <div className="row d-flex justify-content-center mx-auto login-box">
            <div className="col-8 ml-4 d-flex login-img">
                <img src={logo} alt="logo"/>
            </div>
            <div className="col-md-4 col-12 d-flex flex-column mr-4">
                <div className="col-md-12 col-12 d-flex flex-column mb-3">
                    <label for="email" className="form-label font-weight-bold ml-2 " > email</label>
                    <input type="email" id="email" name="email" className="form-control" placeholder="Entrer votre adresse email" />
                </div>
                <div className="col-md-12 col-12 d-flex flex-column mb-3">
                    <label for="password" className="form-label font-weight-bold ml-2 " > password</label>
                    <input type="password" id="password" name="password" className="form-control" placeholder="Entrer votre mot de passe" />
                </div>
                <button className="mx-auto col-4 btn btn-primary" onClick= {handleSubmit} > Submit </button>
            </div>
            
        </div>
    )
}
